@whitesandsnps in #NewMexico, a place like no other on earth, is a marvel to study, experience, and explore. 

The monsoon season begins in July and lasts into late September. These months bring much needed rain and great moments for photographs like this.

Photo by Kevin Shi (sharetheexperience.org). Photo description: Two people walk on the white dunes with misty rain clouds above and mountains in the background. #usinterior #monsoon #photography
